import './App.css';
import Header from './components/Header';
import MainSection from './components/MainSection';
import Notification from './components/Notification';
import SideSection from './components/SideSection';

function App() {

  const NotificationData = [
    {
      topic: 'KULTTUURI',
      body: 'Nirvanan Lepakko-keikan peruuntumisesta joulukuussa 1991 löytyi uutta tietoa – myös nämä peruutukset ovat ikimuistoisia'
    },
    {
      topic: 'PÄIVÄN TIMANTTI',
      body: ''
    }
  ]
  return (
    <div>
      <Header />
      <Notification topic = 'KULTTUURI' body = 'Nirvanan Lepakko-keikan peruuntumisesta joulukuussa 1991 löytyi uutta tietoa – myös nämä peruutukset ovat ikimuistoisia' />
      <Notification topic = 'PÄIVÄN TIMANTTI' body = 'Ismo Alanko onnistui lopettamaan juomisen, kun lääkäri kertoi madonluvut'/>
      <Notification topic = 'MAINOS' body = 'Lunasta kaksi viikkoa maksutonta lukuaikaa!'/>
      <MainSection />
      <SideSection />
    </div>
  );
}

export default App;
